export default function ClientLogos() {

    let logos = [
        {source: "https://tailwindui.com/img/logos/158x48/transistor-logo-gray-900.svg", name: "Transistor"},
        {source: "https://tailwindui.com/img/logos/158x48/reform-logo-gray-900.svg", name: "Reform"},
        {source: "https://tailwindui.com/img/logos/158x48/tuple-logo-gray-900.svg", name: "Tuple"},
        {source: "https://tailwindui.com/img/logos/158x48/savvycal-logo-gray-900.svg", name: "SavvyCal"},
        {source: "https://tailwindui.com/img/logos/158x48/statamic-logo-gray-900.svg", name: "Statamic"}

    ];

    return (
        <div className="mx-auto max-w-7xl px-6 lg:px-8">
          <div className="mt-16 flex justify-center">
            <p className="relative rounded-full px-4 py-1.5 text-sm leading-6 text-gray-600 ring-1 ring-inset ring-gray-900/10 hover:ring-gray-900/20">
              <span className="hidden md:inline">
                Transistor saves up to $40,000 per year, per employee by working with us.
              </span>
              <a href="#" className="font-semibold text-indigo-600">
                <span className="absolute inset-0" aria-hidden="true" /> Read our case study{' '}
                <span aria-hidden="true">&rarr;</span>
              </a>
            </p>
          </div>
          <div className="mx-auto grid max-w-lg grid-cols-4 items-center gap-x-8 gap-y-12 sm:max-w-xl sm:grid-cols-6 sm:gap-x-10 sm:gap-y-14 lg:mx-0 lg:max-w-none lg:grid-cols-5">
            {logos.map((logo)=>{ return(
                <img
                    className="col-span-2 max-h-12 w-full object-contain lg:col-span-1"
                    src={logo.source}
                    alt={logo.name}
                    key={logo.name}
                    width="100%"
                    height="100%"
                />)
            })}

          </div>
        </div>
    );}
